import { writable } from 'svelte/store';
import type { App } from '@src/app';

export const user = writable<App.User | undefined>();
export const users = (() => {
	const { subscribe, update, set } = writable<App.User[]>([
		{
			id: 'redesiigner',
			img: `data:image/png;base64,`,
			name: 'Patrick Hellebrand'
		},
		{
			id: 'davidnoah',
			name: 'David Noah'
		},
		{
			id: 'muskatnuzz',
			name: 'Philipp'
		}
	]);
	return {
		subscribe,
		set,
		update,
		replace: (user: App.User) => {
			update((val) => {
				const index = val.findIndex((u) => u.id === user.id);
				if (index != -1) val[index] = user;
				return val;
			});
		},
		add: (user: App.User) => {
			update((val) => {
				val.push(user);
				return val;
			});
		},
		remove: (user: App.User) => {
			update((val) => {
				val = val.filter((u) => u.id !== user.id);
				return val;
			});
		},
		addRange: (users: App.User[]) => {
			update((val) => {
				val.push(...users);
				return val;
			});
		}
	};
})();
